import React from 'react';
// import { NavLink } from 'react-router-dom';
import Common from './Common';
import web from './images/Home.png';
const Home = () => {
    return (
        <>
           <Common 
           name="Grow your Business" visit='/service' 
           btname='Get Started' imgsrc={web}
        />
        </>
    );
}

export default Home;
